// Home.js
import React from "react";
import "./Home.css";
import restaurantImage from './assets/Restaurant.jpg';

function Home() {
  return (
    <div className="restaurant-container" style={{ backgroundImage: `url(${restaurantImage})` }}>
    <h1>Home</h1>
    <img src={restaurantImage} alt  ="Restaurant" style={{ width: '100%', height: 'auto' }} />
    </div>
  );
}

export default Home;
